import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    background: {
      default: '#091e42', // Deep Blue (background)
    },
    text: {
      primary: '#333333', // Charcoal Gray (text)
    },
    primary: {
      main: '#ffc857', // Rich Gold (primary)
    },
    secondary: {
      main: '#5bc0de', // Slate Blue (secondary)
    },
    success: {
      main: '#4caf50', // Emerald Green (accent)
    },
    info: {
      main: '#3e767b', // Muted Teal (highlight)
    },
  },
});

export default theme;
